import React from "react";
import Map from "../assets/map.png";

const TrafficImage = () => {
  return (
    <div className="bg-teal-500 p-4 flex justify-center items-center rounded-xl flex-none w-1/3">
      <img src={Map} alt="map-picture" className="w-full h-auto" />
    </div>
  );
};

export default TrafficImage;
